import React from "react";
import Card from "./Card";

function EasyCard(props) {



  return (
    <>
      <div className="flex flex-col">
        {props.easyQuestions.forEach(value => {
            <Card number={value.questionNo} description="hello" />    
        })}

        <Card number="helow" description="hwllo" />
        <Card number="helow" description="hwllo" />
      </div>
    </>
  );
}

export default EasyCard;
